  false,\n\t\"url\": null,\n\t\"notes\": \"Seier National Wildlife Refuge personnel
  conducted an inventory of flora and fauna found on the Refuge in 2011. The federally
  endangered American burying beetle (ABB; Nicrophorus americanus) has been documented
  in the Sandhills of Nebraska, but none have been documented at Seier NWR.   This
  report is a summary of the survey that was conducted in June, 2011. This survey
  was successful in documenting the presence of American burying beetles (N. americanus)
  on the Seier NWR. The survey also documented 5 other burying beetles occurring on
  the refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
